Fully Connected Layer 역전파는 쉽게 표현하는 경우 아래 그림과 같습니다.

output을 계산하기 위해서 각자의 id를 가지고 있는 weight가 사용된 곳을 보시면 이해하기 쉽습니다.
예를 들어서 w_{11}은 h_{11}를 연산하는데만 사용되었기 때문에 해당 값만 사용합니다.

